function ConfirmDeletePopup({isOpen, onClose, isLoading, onSubmit, card}) {

  function handleSubmit(e) {
    e.preventDefault();
    onSubmit(card)
  }

  return (
    <PopupWithForm
    isOpen={isOpen}
    onClose={onClose}
    title="Вы уверены?"
    name="popup-delete"
    onSubmit={handleSubmit}
    isLoading={isLoading}
    buttonText="Да"
    loadingText={'Удаление...'}
    ></PopupWithForm>
  );
}

export  {ConfirmDeletePopup};
